// src/pages/RegisterPage.js

import React from "react";
import RegisterForm from "../components/RegisterForm";

const RegisterPage = () => {
  return (
    <div className="form-container">
      <h2>Register</h2>
      <RegisterForm />
    </div>
  );
};

export default RegisterPage;
